const toDecimal = (value)=>{
    return Math.round(value * 100) / 100;
};
const calculateItemTotal = (quantity, price)=>{
    return toDecimal(quantity * price);
};
const sumTotals = (values)=>{
    const sum = values.reduce((acc, val)=>acc + val * 100, 0);
    return sum / 100;
};
